import "./App.css";
import Lenguajes from "./Lenguajes";
import Body from "./Body";

function App() {
  return (
    <div className="App">
      <Body />
      <Lenguajes />
    </div>
  );
}

document.title = "VdeV - Desarrollador Web";
document.querySelector('meta[name="description"]').setAttribute(
  "content",
  "Descubre herramientas esenciales y consejos prácticos para crear y diseñar páginas web asombrosas. Aprende sobre desarrollo web, diseño de interfaces, optimización y más."
);

export default App;
